import React, { useEffect } from 'react';
import style from './AvailableMeals.module.css';
import Card from '../UI/Card';
import MealsItem from './MealsItem/MealsItem';

const DUMMY_MEALS = [
  // {
  //   id: 'm1',
  //   name: 'Wc-Sushi',
  //   description: 'Finest fish and veggies',
  //   price: 22.99,
  // },
  // {
  //   id: 'm2',
  //   name: 'Wc-Schnitzel',
  //   description: 'A german specialty!',
  //   price: 16.5,
  // },
  // {
  //   id: 'm3',
  //   name: 'Barbecue Burger-Wc',
  //   description: 'American, raw, meaty',
  //   price: 12.99,
  // },
  // {
  //   id: 'm4',
  //   name: 'Green Wc-Bowl',
  //   description: 'Healthy...and green...',
  //   price: 18.99,
  // },
];

const httpRequest = async function () {
  const response = await fetch('https://react-movies-http-d18ef-default-rtdb.asia-southeast1.firebasedatabase.app/Meals.json', {
    method: 'POST',
    body: JSON.stringify(...DUMMY_MEALS),
    headers: {
      "content-Type": "application/json",
    }
  })

  const data = await response.json();
  return data;
}

httpRequest()


// console.log(...DUMMY_MEALS)
const AvailableMeals = () => {
  const mealList = DUMMY_MEALS.map(meal => <MealsItem name={meal.name} desc={meal.description} price={meal.price} id={meal.id} key={meal.id}/>)
  return (
    <section className={style.meals}>
      <Card>
        <ul>
          {mealList}
        </ul>
      </Card>
    </section>
  )
}

export default AvailableMeals;
